function Apresentacao (props) {
  let obj ={
    name: "Ayrton",
    idade: 26
  }

  return <h1>Meu nome é {p} e minha idade é {obj.idade} anos.</h1>
}

function App () {
  return(
    <>
      <Apresentacao nome="Victor"/>
      <Apresentacao nome="Marli"/>
      <Apresentacao/>
    </>
  ) 
}

export default App
